import React from 'react';
import '../styles.css';

function Services() {
  return (
    <section id="services" className="services">
      <div className="container">
        <h2>Our Services</h2>
        <p>We offer a wide range of car care services to meet your needs.</p>
      </div>
    </section>
  );
}

export default Services;
